sealed class BolivarException(
    message: String,
) : kotlin.Exception(message) {
    class InvalidPath(
        message: String,
    ) : BolivarException(message)

    class InvalidArgument(
        message: String,
    ) : BolivarException(message)

    class IoNotFound(
        message: String,
    ) : BolivarException(message)

    class IoPermissionDenied(
        message: String,
    ) : BolivarException(message)

    class IoException(
        message: String,
    ) : BolivarException(message)

    class SyntaxException(
        message: String,
    ) : BolivarException(message)

    class EncryptionException(
        message: String,
    ) : BolivarException(message)

    class PdfException(
        message: String,
    ) : BolivarException(message)

    class DecodeException(
        message: String,
    ) : BolivarException(message)

    class RuntimeException(
        message: String,
    ) : BolivarException(message)

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<BolivarException> {
        override fun lift(error_buf: RustBuffer.ByValue): BolivarException = FfiConverterTypeBolivarError.lift(error_buf)
    }
}

/**
 * @suppress
 */
public object FfiConverterTypeBolivarError : FfiConverterRustBuffer<BolivarException> {
    override fun read(buf: ByteBuffer): BolivarException =
        when (buf.getInt()) {
            1 -> BolivarException.InvalidPath(FfiConverterString.read(buf))
            2 -> BolivarException.InvalidArgument(FfiConverterString.read(buf))
            3 -> BolivarException.IoNotFound(FfiConverterString.read(buf))
            4 -> BolivarException.IoPermissionDenied(FfiConverterString.read(buf))
            5 -> BolivarException.IoException(FfiConverterString.read(buf))
            6 -> BolivarException.SyntaxException(FfiConverterString.read(buf))
            7 -> BolivarException.EncryptionException(FfiConverterString.read(buf))
            8 -> BolivarException.PdfException(FfiConverterString.read(buf))
            9 -> BolivarException.DecodeException(FfiConverterString.read(buf))
            10 -> BolivarException.RuntimeException(FfiConverterString.read(buf))
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }

    override fun allocationSize(value: BolivarException): ULong = 4UL

    override fun write(
        value: BolivarException,
        buf: ByteBuffer,
    ) {
        when (value) {
            is BolivarException.InvalidPath -> {
                buf.putInt(1)
                Unit
            }

            is BolivarException.InvalidArgument -> {
                buf.putInt(2)
                Unit
            }

            is BolivarException.IoNotFound -> {
                buf.putInt(3)
                Unit
            }

            is BolivarException.IoPermissionDenied -> {
                buf.putInt(4)
                Unit
            }

            is BolivarException.IoException -> {
                buf.putInt(5)
                Unit
            }

            is BolivarException.SyntaxException -> {
                buf.putInt(6)
                Unit
            }

            is BolivarException.EncryptionException -> {
                buf.putInt(7)
                Unit
            }

            is BolivarException.PdfException -> {
                buf.putInt(8)
                Unit
            }

            is BolivarException.DecodeException -> {
                buf.putInt(9)
                Unit
            }

            is BolivarException.RuntimeException -> {
                buf.putInt(10)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }
}

/**
 * @suppress
 */
public object FfiConverterOptionalUInt : FfiConverterRustBuffer<kotlin.UInt?> {
    override fun read(buf: ByteBuffer): kotlin.UInt? {
        if (buf.get().toInt() == 0) {
